import React, { Component } from 'react';
import './App.css';

import { HomePage } from './pages/homepage/homepage.component'
import { Router } from 'react-router-dom';

class App extends Component {

  render() {
    return (
      <div>
       <Router path='/' component={HomePage}/>
      </div>
    );
  }


}

export default App;
